import React from 'react';
import {HashRouter, Route} from 'react-router-dom'

import Home from './pages/Home'
import Product from './pages/Product'


function App() {
  return (
    <HashRouter basename='/'>
      <Route exact path="/" component={Home} />
      <Route path="/product/:id" component={Product} />
    </HashRouter>
  );
}

export default App;
